Ext.data.JsonP['Alloy_1.7.26_Release_Note']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>Alloy 1.7.26 - 15 November 2015</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n\t\t<div id=\"banner\" class=\"confbox admonition admonition-note aui-message warning shadowed information-macro\">\n\t\t\t<p>You can now find Appcelerator documentation at <a href=\"https://docs.axway.com/\" target=\"_blank\">https://docs.axway.com/</a>. This site will be taken down in the near future.</p></div>\n        <div class=\"header\"/>\n\n        <div id=\"src-46246220\" class=\"content\">\n                        <h1>Alloy 1.7.26 - 15 November 2015</h1>\n    <p>Alloy 1.7.26 is a patch release that includes one bug fix.    </p>\n    <div class=\"section section-2 \" id=\"src-46246220_Alloy1.7.26ReleaseNote-FixedIssue\">\n        <h2 class=\"heading \"><span>Fixed Issue</span></h2>\n    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/ALOY-1331\" target=\"_blank\">ALOY-1331</a> - Windows: App crashes with &apos;Cannot find variable: OS_BLACKBERRY    </p>\n    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=46246220\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"Alloy 1.7.26 Release Note"});